import React from 'react';
import './App.css';
import Filter from './components/Filter'
import DogBar from './components/DogBar'
import RenderDog from './components/RenderDog'

function App() {
  return (
    <div className="App">
      <div id="filter-div">
        <Filter />
      </div>
      <div id="dog-bar">
        <DogBar />
      </div>
      <div id="dog-summary-container">
        <h1>DOGGO:</h1>
        <div id="dog-info">
          <RenderDog />
        </div>
      </div>
    </div>
  );
}

export default App;
